import java.util.*;
import java.lang.*;
class Solution {
    public int rearrangeCharacters(String s, String target) {
        int[] cnt1 = new int[26];
        int[] cnt2 = new int[26];
        for (int i = 0; i < s.length(); ++i) {
            ++cnt1[s.charAt(i) - 'a'];
        }
        for (int i = 0; i < target.length(); ++i) {
            ++cnt2[target.charAt(i) - 'a'];
        }
        int ans = 100;
        for (int i = 0; i < 26; ++i) {
            if (cnt2[i] > 0) {
                ans = Math.min(ans, cnt1[i] / cnt2[i]);
            }
        }
        return ans;
    }
}

import java.util.*;
import java.lang.*;
class Solution {
    public int passThePillow(int n, int time) {
        int num=(time/(n-1));
        if(n>time){
            return time+1;
        }
        if(num%2==1){
            return n-((time%(n-1)));
        }

        return (time%(n-1))+1;
    }
}

import java.util.*;
import java.lang.*;
class Solution {
    public int tribonacci(int n) {
        if(n==0)return 0;
        if(n==1||n==2) return 1;
        int dp[]=new int[n+1];
        dp[0]=0;
        dp[1]=1;
        dp[2]=1;
        for(int i=3;i<=n;i++){
            dp[i]=dp[i-1]+dp[i-2]+dp[i-3];
        }
        return dp[n];
    }
}

