import java.util.*;
import java.lang.*;
class Solution {
    public int minFlips(String target) {
        int flips = 0;
        char prev = target.charAt(0);
        if (prev == '1') flips++;

        for (int i = 1; i < target.length(); i++) {
            char c = target.charAt(i);
            if (c != prev) {
                flips++;
                prev = c;
            }
        }
        return flips;
    }
}

import java.util.*;
import java.lang.*;
class Solution {

    int countDigits(int n) {
        if(n == 0) return 0;
        return n%10 + countDigits(n/10);
    }

    public int countLargestGroup(int n) {

        ArrayList<Integer> list = new ArrayList(Collections.nCopies(37, 0));

        for(int i=1;i<=n;i++) {
            int cd = countDigits(i); // count digits
            list.set(cd, list.get(cd)+1); // update count
        }

        return Collections.frequency(list, Collections.max(list));
    }
}

