import java.util.*;
import java.lang.*;
class Solution {
    public int maxValue(int n, int index, int maxSum) {
        int left = 0, right = maxSum - n;

        while (left < right) {
            int middle = (left + right + 1) / 2;
            if (isPossible(n, index, maxSum - n, middle))
                left = middle;
            else
                right = middle - 1;
        }
        return left + 1;
    }

    private boolean isPossible(int n, int index, int maxSum, int value) {
        int leftValue = Math.max(value - index, 0);
        int rightValue = Math.max(value - ((n - 1) - index), 0);

        long sumBefore = (long) (value + leftValue) * (value - leftValue + 1) / 2;
        long sumAfter = (long) (value + rightValue) * (value - rightValue + 1) / 2;

        return sumBefore + sumAfter - value <= maxSum;
    }
}

import java.util.*;
import java.lang.*;
class Solution {
    public int minimumBuckets(String street)
    {
        Set<Integer> set = new HashSet<>();
        if(!street.contains(".")) return -1;
        int count = 0;
        for(int i=0;i<street.length();i++)
        {
            if(street.charAt(i)=='H')
            {
                if((i==0 && street.charAt(i+1)=='H')||(i==street.length()-1 && street.charAt(i-1)=='H'))
                    return -1;
                else if(i!=0 && i!=street.length()-1 && street.charAt(i+1)=='H' && street.charAt(i-1)=='H')
                    return -1;
            }
            else if(i!=0 && i!=street.length()-1 && street.charAt(i-1)=='H' && street.charAt(i+1)=='H' && !set.contains(i-1) && !set.contains(i+1))
            {
                set.add(i-1);
                set.add(i+1);
                count++;
            }
        }
        for(int i=0;i<street.length();i++)
        {
            if(street.charAt(i)=='H' && !set.contains(i))
                count++;
        }
        return count;
    }
}

